import React from "react";
import "./App.css";
import Navbar from "./components/Navbar";
import Services from "./components/services/Services";
import Projects from "./components/projects/Projects";
import Timeline from "./components/timeline/Timeline";
import Team from "./components/team/Team";
import Partners from "./components/partners/Partners";
import Footer from "./components/footer/Footer";
import HeaderNavs from "./components/headerNavs/HeaderNavs";
import NavbarToggle from "./components/navbarWithToggle/NavbarToggle";
import MainBack from "./components/mainBackground/Mainback";
import CardMain from "./components/team/CardMain";
import ScrollspyNav from "react-scrollspy-nav";

const App = () => {
  return (
    <div className="App">
      <ScrollspyNav
        scrollTargetIds={["section_1", "section_2", "section_3"]}
        offset={100}
        activeNavClass="is-active"
        scrollDuration="1000"
        headerBackground="true"
      >
        <ul>
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="#section_1">Section 1</a>
          </li>
          <li>
            <a href="#section_2">Section 2</a>
          </li>
          <li>
            <a href="#section_3">Section 3</a>
          </li>
        </ul>
      </ScrollspyNav>
      <div>
        <div style={{ height: "400px" }}>
          <span>Welcome!</span>
        </div>
        <div id="section_1" style={{ height: "500px" }}>
          <span>Section 1</span>
        </div>
        <div id="section_2" style={{ height: "500px" }}>
          <span>Section 2</span>
        </div>
        <div id="section_3" style={{ height: "500px" }}>
          <span>Section 3</span>
        </div>
      </div>
      <HeaderNavs />
      <Navbar />
      <NavbarToggle />
      <MainBack />
      <Services />
      <Projects />
      <Timeline />
      <Team />
      <Partners />
      <Footer />
    </div>
  );
};

export default App;
